import api from './api';

// Get swim sets for a workout
export const getSwimSetsForWorkout = (workoutId) => {
  return api.get(`/workouts/${workoutId}/swim-sets`);
};

// Add swim set to workout
//export const addSwimSetToWorkout = (workoutId, swimSetId) => {
//  return api.post(`/workouts/${workoutId}/swim-sets/${swimSetId}`);
//};
export const addSwimSetToWorkout = (workoutId, swimSetData) => {
  return api.post(`/workouts/${workoutId}/swim-sets`, swimSetData);
};

// Remove swim set from workout
export const removeSwimSetFromWorkout = (workoutId, swimSetId) => {
  return api.delete(`/workouts/${workoutId}/swim-sets/${swimSetId}`);
};
